window.bookSummaryJSON = "<p>Flynn's girlfriend, January, is missing. The cops are asking question he can't answer, and her friends are telling stories that don't add up. All eyes are on Flynn―as January's boyfriend, he must know something. </p> <p>But Flynn has a secret of his own. And as he struggles to uncover the truth about January's disappearance, he must also face the truth about himself. </p>"; 
